  false,\n\t\"url\": null,\n\t\"notes\": \"Digital orthographic imagery datasets contain
  georeferenced images of the Earth's surface, collected by a sensor in which object
  displacement has been removed for sensor distortions and orientation, and terrain
  relief. Digital orthoimages have the geometric characteristics of a map and image
  qualities of a photograph. (Source: Circular A-16, p. 16) This metadata record describes
  the 2005 digital ortho mapping of Otsego County, New York. Image pixel size is 60
  centimeters GSD. Image type is panchromatic. Image horizontal accuracy is +/-8 ft.
  at the 95% confidence level. Each file contains an image covering 1500 meters by
  1500 meters on the ground. The coordinate system used for the production of this
  FIRM is Universal Transverse Mercator (UTM), North American Datum of 1983 (NAD 83),
  GRS80 spheroid. Corner coordinates shown on the FIRM are in latitude and longitude
  referenced to the UTM projection, NAD 83. Differences in the datum, spheroid, projection
  or UTM zones used in the production of FIRMS for adjacent counties may result in
  slight positional differences in map features at the county boundaries. These differences
  do not affect the accuracy of information shown on the FIRM.\",\n\t\"license_title\":
